import React from "react";
import Entry from "./Entry.jsx";
import emojipedia from "../emojipedia.js";

function App() {
  return (
    <div>
      <h1>
        <span>emojipedia</span>
      </h1>
       <Entry 
           icon = {emojipedia[0].emoji}
           name = {emojipedia[0].name}
           detail = {emojipedia[0].meaning}
           />
    </div>
  );
}

export default App;
